import React, { useState } from "react";

const [isdone,setisdone] = useState(false);
function handleclick(){
    setisdone(prevValue =>{
        return !prevValue;
    })
}

function Li(props){
    return (
    <div onClick={handleclick}>
       <li style={isdone ? {textDecoration:"line-through"}:"null"}>{props.text}</li>
    </div>)
}
export default Li;
